import QueenCard from "./QueenCard/QueenCard.js";


class App extends Component {
  constructor(){
    super();
    this.state = {
      queens: []
    }
  }

  componentDidMount() {
    this.getQueens();
  }

  getQueens = () => {
    Axios({
      method: "GET",
      url: "http://www.nokeynoshade.party/api/queens/all",
      dataResponse: "json"
    }).then(response => {
      response = response.data;
      console.log(response);
      this.setState({
        queens: response
      })
    })
  }

  render() {
    return (
      <div className="App">
        <Header />
        {/* {this.state.queens.map(queen => {
          return (
            <QueenCard 
              key={queen.id}
              name={queen.name}
              imageSrc={queen.image_url}
            />
          )
        })} */}
        <Footer />
      </div>
    );
  }
}

export default App;
